import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import NavMenu from './component/NavMenu/NavMenu';
import LandingPage from './component/LandingPage'; // Make sure the path is correct
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import ContactPage from './component/ContactPage/ContactPage';
import ComicsPage from './component/ComicsPage/ComicsPage';

function App() {
  return (
    <Router>
      <NavMenu />
      <Switch>
        <Route path="/" exact component={<LandingPage/>} />
        <Route path="/coding" component={<CodingPage/>} />
        <Route path="/comics" component={<ComicsPage/>} />
        <Route path="/contact" component={<ContactPage/>} />
      </Switch>
    </Router>
  );
}

export default App;
